// ==UserScript==
// @name         atcoder-bell
// @namespace    https://github.com/yoshrc
// @version      1.0
// @description  Ring a bell when AtCoder finishes judge
// @author       yoshrc
// @match        https://atcoder.jp/contests/*/submissions/me
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/377923/atcoder-bell.user.js
// @updateURL https://update.greasyfork.org/scripts/377923/atcoder-bell.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // How to play binary encoded audio:
    // https://iandevlin.com/html5/data-uri/audio.php
    // Sounds are created by Taira Komori, All Rights Reserved.
    // http://taira-komori.jpn.org/freesound.html
    const acceptedAudio = document.createElement('audio');
    acceptedAudio.setAttribute('id', 'accepted-audio');
    acceptedAudio.setAttribute('src', 'data:audio/mp3;base64,');

    const rejectedAudio = document.createElement('audio');
    rejectedAudio.setAttribute('id', 'rejected-audio');
    rejectedAudio.setAttribute('src', 'data:audio/mp3;base64,');

    // list of date and time of submissions wating for judge in string
    const waitingSubmissions = new Set([]);

    function isRejected(submissionResult) {
        const rs = ["CE", "MLE", "TLE", "RE", "OLE", "IE", "WA"];
        let i;
        for (i = 0; i < rs.length; i++) {
            if (submissionResult.includes(rs[i])) {
                return true;
            }
        }
        return false;
    }

    function isWaitingJudge(submissionResult) {
        return submissionResult !== "AC" && !isRejected(submissionResult);
    }

    function watch() {
        const rows = document.querySelectorAll('tbody>tr');
        let i;
        for (i = 0; i < rows.length; i++) {
            const submission = rows[i].querySelector('time').textContent;
            const result = rows[i].querySelector('span.label').textContent;
            if (waitingSubmissions.has(submission)) {
                if (result === "AC") {
                    waitingSubmissions.delete(submission);
                    acceptedAudio.play();
                } else if (isRejected(result)) {
                    waitingSubmissions.delete(submission);
                    rejectedAudio.play();
                }
            } else if (isWaitingJudge(result)) {
                waitingSubmissions.add(submission);
            }
        }

        window.setTimeout(watch, 500);
    }

    watch();
})();
